export default (state=[], action) => {
	console.log(action.type)
	switch (action.type) {
		case 'USER_INIT':
      return {omsNumber: null, birthDate: null, authorizationFlag: false};

		case 'USER_CHECK':
			return {omsNumber: null, birthDate: null, authorizationFlag: false}

		case 'USER_SUCCESS':
			return {omsNumber: action.payload[0], birthDate: action.payload[1], authorizationFlag: true};

		case 'USER_FAILURE':
			return {omsNumber: null, birthDate: null, authorizationFlag: false};

		default:
			return {omsNumber: localStorage.getItem('omsNumber'), birthDate: localStorage.getItem('birthDate'), authorizationFlag: Boolean(localStorage.getItem('omsNumber'))};
	}
};
